import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { Box, Paper, Button, IconButton, InputBase, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle, Slide } from "@mui/material";
import { DataGrid } from "@mui/x-data-grid";
import { styled, alpha } from "@mui/material/styles";
import SearchIcon from "@mui/icons-material/Search";
import DeleteRoundedIcon from "@mui/icons-material/DeleteRounded";
import EditRoundedIcon from "@mui/icons-material/EditRounded";
import AddIcon from "@mui/icons-material/Add";

// Search Bar Styling
const Search = styled("div")(({ theme }) => ({
  position: "relative",
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha(theme.palette.common.black, 0.05),
  "&:hover": { backgroundColor: alpha(theme.palette.common.black, 0.1) },
  margin: "auto",
  width: "100%",
  maxWidth: 400,
  display: "flex",
  alignItems: "center",
  padding: theme.spacing(0.5, 1),
}));

const DisplayGroupChats = ({ groupChats, onDelete }) => {
  const navigate = useNavigate();
  const [searchQuery, setSearchQuery] = useState("");
  const [open, setOpen] = useState(false);
  const [selectedId, setSelectedId] = useState(null);

  const handleClickOpen = (id) => {
    setSelectedId(id);
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
    setSelectedId(null);
  };

  const handleConfirmDelete = () => {
    onDelete(selectedId);
    handleClose();
  };

  const filteredRows = groupChats.filter(
    (chat) =>
      chat.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
      chat.speciality.toLowerCase().includes(searchQuery.toLowerCase())
  );

  // Row click handler for navigation
  const handleRowClick = (param, event) => {
    // Prevent row click event if the action button is clicked
    if (event.target.closest(".action-buttons")) {
      return;
    }
    const selectedRowId = param.row.id;
    navigate(`/admin/chats/${selectedRowId}`); // Navigate to the group chat's details page
  };

  return (
    <Box>
      {/* Search Bar */}
      <Box sx={{ my: 2, display: "flex", justifyContent: "center" }}>
        <Search>
          <SearchIcon />
          <InputBase
            placeholder="Search Group Chats…"
            inputProps={{ "aria-label": "search" }}
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
        </Search>
      </Box>

      {/* Table */}
      <Paper sx={{ height: 400, width: "100%" }}>
        <DataGrid
          rows={filteredRows}
          columns={[
            { field: "id", headerName: "ID", width: 70 },
            {
              field: "name",
              headerName: "Group Name",
              width: 200,
            },
            { field: "level", headerName: "Level", width: 150 },
            { field: "speciality", headerName: "Speciality", width: 200 },
            { field: "creationDate", headerName: "Creation Date", width: 180 },
            { field: "term", headerName: "Term", width: 120 },
            {
              field: "actions",
              headerName: "Actions",
              width: 120,
              renderCell: (params) => (
                <Box display="flex" gap={1} className="action-buttons">
                  <IconButton 
                    onClick={(e) => {
                      e.stopPropagation(); // Prevent row click event
                      navigate(`/admin/chats/edit/${params.row.id}`);
                    }}
                  >
                    <EditRoundedIcon style={{ color: "blue" }} />
                  </IconButton>

                  <IconButton 
                    onClick={(e) => {
                      e.stopPropagation(); // Prevent row click event
                      handleClickOpen(params.row.id);
                    }}
                  >
                    <DeleteRoundedIcon style={{ color: "black" }} />
                  </IconButton>
                </Box>
              ),
            },
          ]}
          pageSizeOptions={[5, 10]}
          onRowClick={handleRowClick} // Trigger navigation on row click
          sx={{ border: 0 }}
        />
      </Paper>

      {/* Add Group Button */}
      <Box display="flex" justifyContent="flex-end" mt={2}>
        <Button
          variant="contained"
          color="primary"
          startIcon={<AddIcon />}
          onClick={() => navigate("/admin/chats/create")}
        >
          Add Group
        </Button>
      </Box>

      {/* Delete Confirmation Dialog */}
      <Dialog open={open} TransitionComponent={Slide} keepMounted onClose={handleClose}>
        <DialogTitle>{"Are you sure you want to delete?"}</DialogTitle>
        <DialogContent>
          <DialogContentText>This action cannot be undone.</DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="secondary">Cancel</Button>
          <Button onClick={handleConfirmDelete} color="primary">Confirm</Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default DisplayGroupChats;
